import React from "react";

export const Todoitem = (props) => {
  return (
    <div class="card my-5">
      <div class="card-body">
        <h5 class="card-title">{props.todo.title}</h5>
        <p class="card-text">
          {props.todo.desc}
        </p>
        <button className="btn btn-sm btn-danger" onClick={props.todo.onDelete}>
          Delete
        </button>
      </div>
    </div>

  );
};
